/*									                      FRAME																								*/		
																
Frame DummyFrame;
																
FRAME buildDummyFrame(SPRITE s, uint16_t x, uint16_t y, uint32_t interval, bool flip, bool draw){
	FRAME f = GET_FRAME(DummyFrame); 
	f->s = s;
	f->x = x;
	f->y = y;
	f->interval = 0;
	f->flip = false;
	f->draw = true;
	return f;
}																

void cancelFrame(FRAME f){
	uint16_t i, j, color, x, y, W, H;
	
	x = f->x;
	y = f->y - f->s->HEIGHT;
	W = (f->x + f->s->WIDTH <= MAX_X)? f->s->WIDTH : (MAX_X - f->x);
	H = f->s->HEIGHT;
	
	LCD_SetWindow(x, y, W, H);
	LCD_CS(0);
	LCD_WriteCommand(0x22);
	LCD_RS(1);
	for(j = 0; j < H ; j++){	
		for(i = 0; i < W; i++){
			color = BACKGROUND_BM[(j + y) * BACKGROUND_WIDTH + (i + x)];
			LCD_WritePixel(color);
		}
	}
	LCD_CS(1);	
}


void drawFrame(FRAME f){
	uint16_t i, j, color, W, H, x, y;
	
	x = f->x;
	y = f->y - f->s->HEIGHT;
	W = (f->x + f->s->WIDTH <= MAX_X)? f->s->WIDTH : (MAX_X - f->x);
	H = f->s->HEIGHT;

	LCD_SetWindow(x, y, W, H);
	LCD_CS(0);
	LCD_WriteCommand(0x22);
	LCD_RS(1);
	if (!f->flip){
		for(j = 0; j < H ; j++){	
			for(i = 0; i < W; i++){
				color = f->s->BM[j * f->s->WIDTH + i];
				if(color == NO_COLOR) color = BACKGROUND_BM[(j + y) * BACKGROUND_WIDTH + (i + x)];
				LCD_WritePixel(color);
			}
		}
	}
	else{
		for(j = 0; j < H ; j++){	
			for(i = 0; i < W; i++){
				color = f->s->BM[j * f->s->WIDTH + (f->s->WIDTH - 1) - i];
				if(color == NO_COLOR) color = BACKGROUND_BM[(j + y) * BACKGROUND_WIDTH + (i + x)];
				LCD_WritePixel(color);
			}
		}
	}
	LCD_CS(1);	
}

void sendFrame(FRAME f){
	if(!f->draw) cancelFrame(f);
	else drawFrame(f);
}

/*									                      ANIMATIONS																							*/		

static ANIMATION a = GET_ANIMATION(still);
static bool isBusy;
static int animation_index;
static int old_index;

ANIMATION getAnimation(uint8_t animation_number){
	ANIMATION x;
	switch(animation_number){
		case(STILL):
			x = GET_ANIMATION(still);
			break;
		case(MEAL):
			x = GET_ANIMATION(meal);
			break;
		case(SNACK):
			x = GET_ANIMATION(snack);
			break;
		case(RUN):
			x = GET_ANIMATION(run);
			break;
		case(CUDDLE):
			x = GET_ANIMATION(cuddle);
			break;
	}
	return x;
}

void initAnimation(uint8_t animation_number){
	animation_index = 0;
	
	if(a->frames[old_index]->draw)cancelFrame(a->frames[old_index]);
	
	a = getAnimation(animation_number);
	if(a->action > 0) isBusy = true;
	//else isBusy = false;
	animate();
}

void concludeAnimation(){
	if(a->action == 1) increaseSatiety();
	else if (a->action == 2) increaseHappiness();
	else if(a->action == 3) drawButton(2);
	
	if(a->action != 3){
		initAnimation(0); 
	}
	
	isBusy = false;
	//enable_RIT();
}

void animate(){
	do{
		sendFrame(a->frames[animation_index]);
		old_index = animation_index;
		animation_index += 1;
		if(animation_index >= a->n){
			if(a->loop){
				animation_index = 0;
			}
			else{
				concludeAnimation();
				return;
			}
		}
	}while(a->frames[old_index]->interval == 0);
	AnimationTimerInterval( 0, a->frames[old_index]->interval);
	reset_timer(0);
	enable_timer(0);
	return;
}

