#define MAX_SATIETY 5
#define MAX_HAPPINESS 5


static uint8_t satiety;
static uint8_t happiness;

void initStatus(){
	GUI_Text(68, 4, (uint8_t *) "Age: 00:00:00", Black, 0xEEB5);
	for(satiety = 0, happiness = 0; satiety < MAX_SATIETY && happiness < MAX_HAPPINESS; increaseSatiety(), increaseHappiness());
}

void increaseSatiety(){
	FRAME f;
	if (satiety == MAX_SATIETY) return;
	satiety++;
	f = buildDummyFrame(GET_SPRITE(Food1), 10 + ((satiety - 1) * 20), 40, 0, false, true);
	drawFrame(f);
	return;
}
void decreaseSatiety(){
	FRAME f = buildDummyFrame(GET_SPRITE(Food2), 10 + ((satiety - 1) * 20), 40, 0, false, true);
	drawFrame(f);
	satiety--;
	if (satiety == 0 && !end) endGame();
	return;
}

void increaseHappiness(){
	FRAME f;
	if (happiness == MAX_HAPPINESS) return;
	happiness++;
	f = buildDummyFrame(GET_SPRITE(Heart1), 130 + ((happiness - 1) * 20), 40, 0, false, true);
	drawFrame(f);
	return;
}

void decreaseHappiness(){
	FRAME f = buildDummyFrame(GET_SPRITE(Heart2), 130 + ((happiness - 1) * 20), 40, 0, false, true);
	drawFrame(f);
	happiness--;
	if (happiness == 0 && !end) endGame();
	return;
}

#define DECREASE_TIME 5
static uint32_t time_counter;
static bool decrease_flag;
	
void updateTime(){
	uint32_t s, m, h;
	int tmp;
	char time[32];
		
	time_counter++;
	s = time_counter % 60;
	m = (time_counter/60) % 60;
	h = time_counter / 3600;
	
	tmp = sprintf(time, "Age: %02d:%02d:%02d", h,m,s);
	GUI_Text(MAX_X/2 - (tmp* 8)/2, 4, (uint8_t *) time, Black, 0xEEB5);
	
	if((time_counter % DECREASE_TIME) == 0){
		decrease_flag = true;
	}
	
	if( decrease_flag && !isBusy){
		decrease_flag = false;
		decreaseSatiety();
		decreaseHappiness();
	}
}

#define LEFT 0
#define RIGHT 1

static uint8_t selection;

void checkJoyStick(){
	
	if(!end){
		if((LPC_GPIO1->FIOPIN & (1 << 27)) == 0 && selection != LEFT){ 
			selection = LEFT;
			drawButton(selection);
		}
		else if((LPC_GPIO1->FIOPIN & (1 << 28)) == 0 && selection != RIGHT) {
			selection = RIGHT;
			drawButton(selection);
		}	
	}
	
	if(!isBusy && (LPC_GPIO1->FIOPIN & (1 << 25)) == 0){
//		disable_RIT();
//		reset_RIT();
		if(end == true) startGame();
		else if(selection == LEFT) initAnimation(1);
		else if(selection == RIGHT) initAnimation(2);
	}
  return;
}

void startGame(){
	static uint32_t game = 0;
	
	time_counter = 0;
	drawBackground();
	
	selection = LEFT;
	drawButton(0);
	
	isBusy = false;
	initStatus();
	initAnimation(0);
	if(game++ == 0) enable_RIT();
	enable_timer(1);
	end = false;
}

void endGame(){
//	disable_RIT();
//	reset_RIT();
	end = true;
	disable_timer(1);
	reset_timer(1);
	initAnimation(3);
	return;
}

void initGameTimers(){
	init_timer(0, 1);	// valore a caso, verr sovrascritto subito
	init_timer(1,  _1SEC/_SCALING_FACTOR);	// 1sec
	init_RIT(_50MS/_SCALING_FACTOR); //50ms
}

